import React from "react";

const Table: React.FC = () => {
  const test = () => {
    fetch("http://localhost:5000/api/tasks").then((res) => {
      console.log(res);
    });
  };

  return (
    <div>
      <table className="table">
        <thead>
          <tr>
            <th>Task Id</th>
            <th>Task Title</th>
            <th>Task Description</th>
          </tr>
        </thead>
      </table>
    </div>
  );
};

export default Table;
